using System.Web;

namespace Sistema.Api.dll.Repositorio.Util.Componentes.Templates
{
    public class SubmoduloWireFrameTemplate
    {
        public GroupComponent Content { get; set; }
        public Heading TituloPagina { get; set; }
        public BreadcrumbTemplate BreadcrumbTemplate { get; set; }
        public Div GridContainer { get; set; }
        public Grid Grid { get; set; }
        public Img ImageLoading { get; set; }

        public SubmoduloWireFrameTemplate()
        {
            Content = new GroupComponent();
            TituloPagina = new Heading();
            BreadcrumbTemplate = new BreadcrumbTemplate();
            GridContainer = new Div();
            Grid = new Grid();
            ImageLoading = new Img();
        }

        public void SetTemplate()
        {
            //Set titulo
            TituloPagina.Id = "titulo-modulo";
            TituloPagina.HeadingType = HeadingType.H1;
            TituloPagina.Style = "diaplay:none;";

            //ImageLoading
            ImageLoading.Src = "data:image/gif;base64,";
            ImageLoading.Style = "display:none;margin-top:15px";
            ImageLoading.Class = "ImageLoading";

            //Grid container
            GridContainer.Class = "col-md-12";
            GridContainer.Id = "grid-container";
        }


        public virtual void Render()
        {
            HttpContext.Current.Response.Write(ToString());
        }

    }
}